        private readonly int mergedSpacesCount;
        private readonly int vocabCount;

        private readonly Dictionary<string, int> encodings;
        private readonly Dictionary<int, string> decodings;

        private Dictionary<int, char> byteEncoder;
        private readonly Dictionary<char, int> byteDecoder;

        private Dictionary<(string, string), double> bpeRanks;
        private readonly Dictionary<string, string> cache;

        private static GptTokenizer? _gpt3Tokenizer;
        private static SemaphoreSlim _gpt3Semaphore = new(1, 1);
        private static GptTokenizer? _codexTokenizer;
        private static SemaphoreSlim _codexSemaphore = new(1, 1);

        /// <summary>
        /// Returns the singleton instance for the Gpt3 Tokenizer
        /// </summary>
        /// <returns>The singleton instance for the tokenizer</returns>
        public static async Task<GptTokenizer> GetGpt3TokenizerAsync()
        {
            await _gpt3Semaphore.WaitAsync();
            if (_gpt3Tokenizer is null)
            {
                _gpt3Tokenizer = await CreateTokenizerAsync();
            }
            _gpt3Semaphore.Release();
            return _gpt3Tokenizer;
        }

        /// <summary>
        /// Returns the singleton instance for the Codex tokenizer
        /// </summary>
        /// <returns>The singleton instance for the tokenizer</returns>
        public static async Task<GptTokenizer> GetCodexTokenizerAsync()
        {
            await _codexSemaphore.WaitAsync();
            if (_codexTokenizer is null)
            {
                _codexTokenizer = await CreateTokenizerAsync(GptTokenizerType.Codex);
            }
            _codexSemaphore.Release();
            return _codexTokenizer;
        }


        /// <summary>
        /// Creates a new tokenizer, by asynchronously loading the default resources
        /// </summary>
        /// <param name="tokenizerType">Type for the tokenizer (Default <see cref="GptTokenizerType.Gpt3"/></param>
        /// <returns>A new <see cref="GptTokenizer"/> initialized with the default data</returns>
        public static Task<GptTokenizer> CreateTokenizerAsync(GptTokenizerType tokenizerType = GptTokenizerType.Gpt3)
        {
            var vocabBase64 = @"";
            var encoderBase64 = @"";

            using var vocab = new GZipStream(new MemoryStream(Convert.FromBase64String(vocabBase64)), CompressionMode.Decompress);
            using var encoder = new GZipStream(new MemoryStream(Convert.FromBase64String(encoderBase64)), CompressionMode.Decompress);

            return CreateTokenizerAsync(vocab, encoder, tokenizerType);
        }

        /// <summary>
        /// Creates a new tokenizer, by asynchronously loading the required resources
        /// </summary>
        /// <param name="bpeVocabStream">A stream containing a valid "vocab.bpe" file</param>
        /// <param name="encoderJsonStream">A stream containing a valid "encodings.json" file</param>
        /// <param name="tokenizerType">Type for the tokenizer (Default <see cref="GptTokenizerType.Gpt3"/></param>
        /// <returns>A new <see cref="GptTokenizer"/> initialized with the supplied data</returns>
        public static async Task<GptTokenizer> CreateTokenizerAsync(Stream bpeVocabStream, Stream encoderJsonStream, GptTokenizerType tokenizerType = GptTokenizerType.Gpt3)
        {
            using var bpeVocabReader = new StreamReader(bpeVocabStream);
            using var encoderJsonReader = new StreamReader(encoderJsonStream);

            var bpeVocabLines = await ReadAllLinesAsync(bpeVocabReader);
            var encoderJsonText = await encoderJsonReader.ReadToEndAsync();
            var encoderJsonDictionary = JsonSerializer.Deserialize<Dictionary<string, int>>(encoderJsonText);

            return new GptTokenizer(bpeVocabLines, encoderJsonDictionary, tokenizerType);
        }

        private static async Task<string?[]> ReadAllLinesAsync(StreamReader streamReader)
        {
            var result = new List<string?>();

            while (!streamReader.EndOfStream)
                result.Add(await streamReader.ReadLineAsync());

            return result.ToArray();

        }

        private GptTokenizer(string[] bpeVocabLines, Dictionary<string, int> encoderJson, GptTokenizerType tokenizerType)
        {
            encodings = encoderJson;
            mergedSpacesCount = tokenizerType is GptTokenizerType.Codex ? 24 : 0;
            vocabCount = 50257 + mergedSpacesCount;
            decodings = new();
            bpeRanks = new();
            byteEncoder = new();
            byteDecoder = new();
            cache = new();
            Initialize(bpeVocabLines);
        }

        private void Initialize(string[] bpeVocabLines)
        {
            var vocabLines = bpeVocabLines;
            var bpeMerges = vocabLines[1..^1]
                .Select((line) => Regex.Split(line, @"(\s+)")
                    .Where(part => part.Trim().Length > 0)
                    .ToArray()
                )
                .Select(x => (x[0], x[1]))
                .ToList();

            if (mergedSpacesCount > 0)
            {
                for (var i = 1; i < mergedSpacesCount; i++)
                {
                    for (var j = 1; j < mergedSpacesCount; j++)
                    {
                        if (i + j <= mergedSpacesCount)
                        {
                            bpeMerges.Add((new string('\u0120', i), new string('\u0120', j)));
                        }
                    }
                }

                for (var i = 0; i < mergedSpacesCount; i++)
                {
                    encodings[new string('\u0120', i + 2)] = vocabCount - mergedSpacesCount + i;
                }
            }

            foreach (var key in encodings.Keys)
            {
                decodings[encodings[key]] = key;
            }

            byteEncoder = CreateBytesToUnicodeMap();

            foreach (var (key, value) in byteEncoder)
                byteDecoder[value] = key;

            bpeRanks = bpeMerges
                .Select((e, i) => (e, (double)i))
                .ToDictionary();
        }

        private static IEnumerable<int> CreateRange(int start, int end)
        {
            while (start <= end)
            {
                yield return start;
                start++;
            }
        }

        private Dictionary<int, char> CreateBytesToUnicodeMap()
        {
            var byteValues = CreateRange('!', '~')
                .Concat(CreateRange('\xa1', '\xac'))
                .Concat(CreateRange('\xae', '\xff'))
                .ToList();

            var charset = byteValues.ToList();
            var n = 0;

            for (var byteValue = 0; byteValue < 256; byteValue++)
            {
                if (!byteValues.Contains(byteValue))
                {
                    byteValues.Add(byteValue);
                    charset.Add(256 + n);
                    n++;
                }
            }

            var bytesToUnicodeMap = byteValues
                .Zip(charset.Select(c => (char)c))
                .ToDictionary();

            return bytesToUnicodeMap;
        }

        private ISet<(string, string)> GetPairs(List<string> word)
        {
            var pairs = new HashSet<(string, string)>();
            var prevChar = word[0];

            for (var i = 1; i < word.Count; i++)
            {
                var c = word[i];
                pairs.Add((prevChar, c));
                prevChar = c;
            }

            return pairs;
        }

        private string GetBpeEntryForToken(string token)
        {
            if (cache.ContainsKey(token))
            {
                return cache[token];
            }

            var word = token.ToCharArray().Select(x => $"{x}").ToList();

            var pairs = GetPairs(word);

            if (pairs is null or { Count: 0 })
            {
                return token;
            }

            while (true)
            {
                var minPairs = new Dictionary<double, (string, string)>();

                foreach (var pair in pairs)
                {
                    if (!bpeRanks.TryGetValue(pair, out var rank))
                        rank = 1e11;

                    minPairs[rank] = pair;
                }

                var bigram = minPairs[minPairs.Keys.Min()];

                if (!bpeRanks.ContainsKey(bigram))
                {
                    break;
                }

                var (first, second) = bigram;

                var newWord = new List<string>();
                var i = 0;

                while (i < word.Count)
                {
                    var j = word.IndexOf(first, i);
                    if (j is -1)
                    {
                        newWord.AddRange(word.Skip(i));
                        break;
                    }

                    newWord.AddRange(word.Skip(i).Take(j - i));
                    i = j;

                    if (word[i] == first && i < word.Count - 1 && word[i + 1] == second)
                    {
                        newWord.Add(first + second);
                        i += 2;
                    }
                    else
                    {
                        newWord.Add(word[i]);
                        i++;
                    }
                }

                word = newWord;
                if (word.Count is 1)
                {
                    break;
                }
                else
                {
                    pairs = GetPairs(word);
                }
            }

            cache[token] = string.Join(" ", word);
            return cache[token];
        }

        /// <summary>
        /// Converts a text to its GPT token representation.
        /// </summary>
        /// <param name="text">The text to convert</param>
        /// <returns>The GPT token sequence representing the supplied text</returns>
        public int[] GetTokens(string text)
        {
            var bpeTokens = new List<int>();

            var matches = GetBpeParserRegex().Matches(text);

            foreach (var match in matches.Cast<Match>())
            {
                var token = Encoding.UTF8.GetBytes(match.Value).Select((x) => byteEncoder[x]).JoinStrings("");
                var newTokens = GetBpeEntryForToken(token).Split(' ').Select((x) => encodings[x]).ToList();
                bpeTokens.AddRange(newTokens);
            }

            return bpeTokens.ToArray();
        }

        /// <summary>
        /// Converts a GPT Token sequence to its text representation
        /// </summary>
        /// <param name="tokens">The GPT Token sequence to convert</param>
        /// <returns>The text representation of each element of the supplied GPT token sequence</returns>
        public IEnumerable<string> GetTextFromTokens(IEnumerable<int> tokens)
        {
            var text = tokens.Select((x) => decodings[x]);

            foreach (var t in text)
                yield return Encoding.UTF8.GetString(t.ToCharArray().Select((x) => byteDecoder[x]).Select(x => (byte)x).ToArray());
        }
    }
